class Solution:
    def lengthOfLongestSubstring(self, s):
        max_length = 1 if len(s) > 0 else 0
        i = 0
        j = i + 1
        while i < len(s):
            while j < len(s):
                n = s.rfind(s[j], i, j)
                if n >= 0:
                    i = n
                    break
                max_length = max(j - i + 1, max_length)
                j += 1
            i += 1
        return max_length


